import profile from '../../assets/images/NCT_도영.PNG';

import * as React from 'react';
import Box from '@mui/material/Box';
import IconButton from '@mui/material/IconButton';
import Typography from '@mui/material/Typography';
import Menu from '@mui/material/Menu';
import Avatar from '@mui/material/Avatar';
import Tooltip from '@mui/material/Tooltip';
import MenuItem from '@mui/material/MenuItem';
import { Notification } from '@mui/material';

const settings = ['GPS 영역', '나의 채팅함', '마이페이지'];

const ProfileImage = () => {
    
    const [anchorElUser, setAnchorElUser] = React.useState(null);
  
    const handleOpenUserMenu = (event) => {
        setAnchorElUser(event.currentTarget);
    };
  
  
    const handleCloseUserMenu = () => {
        setAnchorElUser(null);
    };

    return (
        <div class="profile-image-container">
            
            <Box sx={{ flexGrow: 0 }}>
            <Tooltip>
              <IconButton onClick={handleOpenUserMenu} sx={{ p: 0 }}>
                <img id='profile-image' className='profile-image gradient-border background-image' src={profile}></img>
              </IconButton>
            </Tooltip>
            <Menu
              sx={{ mt: '45px' }}
              id="menu-appbar"
              anchorEl={anchorElUser}
              anchorOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              keepMounted
              transformOrigin={{
                vertical: 'top',
                horizontal: 'right',
              }}
              open={Boolean(anchorElUser)}
              onClose={handleCloseUserMenu}
            >
              <MenuItem onClick={handleCloseUserMenu}>
                  <Notification></Notification>
                  <Typography textAlign="center">나의 채팅함</Typography>
              </MenuItem>
              <MenuItem onClick={handleCloseUserMenu}>
                  <Typography textAlign="center">마이페이지</Typography>
              </MenuItem>
              
            </Menu>
          </Box>
        </div>
        
    )
}

export default ProfileImage;
